import React from 'react';

const user = (props) => {
    return(
        <div>
            <h1>Name : {props.name}</h1>
            <p>Age : {props.age}</p>
            <p>I am in user component</p>
            <style jsx>{`
                div {
                    border : 1px solid #eee;
                    box-shadow : 0 2px 3px #ccc;
                    padding : 20px;
                    text-align : center;
                }
            `}
            </style>
        </div>
    )
};

export default user;
